import React from 'react';
// import { directive } from '@babel/types';
// import React, { Component } from 'react';

const App = () => {
  return (
    <React.Fragment>
      <label htmlFor="bar">bar</label>
      <input type="text" onChange={() => {console.log("hello")}} />
      <User name={'Taro'} />
    </React.Fragment>
  );
}

const User = (props) => {
  return (
    <div>Hi, I am {props.name}</div>
  );
}


export default App;
